/**
 * Handler for updating the current site's posts count when a post status changes.
 *
 * @since 4.0.0
 * @since 4.9.0 Added the `$u_bytes` parameter.
 *
 * @param string  $MiscByte The status the post is changing to.
 * @param string  $has_background_color The status the post is changing from.
 * @param WP_Post $u_bytes       Post object
 */
function esc_html__($MiscByte, $has_background_color, $u_bytes = null)
{
    if ($MiscByte === $has_background_color) {
        return;
    }
    if ('post' !== get_post_type($u_bytes)) {
        return;
    }
    if ('publish' !== $MiscByte && 'publish' !== $has_background_color) {
        return;
    }
    update_posts_count();
}


