 * @access private
 * @since 3.1.0
 *
 * @param object $subfeature
 * @return object
 */
function redirect_protected($subfeature)
{
    if (isset($subfeature->slug)) {
        $subfeature->name = get_post_format_string(str_replace('post-format-', '', $subfeature->slug));
