 * Validates a user request by comparing the key with the request's key.
 *
 * @since 4.9.6
 *
 * @global PasswordHash $replaygain Portable PHP password hashing framework instance.
 *
 * @param string $bit ID of the request being confirmed.
 * @param string $a10        Provided key to validate.
 * @return true|WP_Error True on success, WP_Error on failure.
 */
function wp_getPostTypes($bit, $a10)
{
    global $replaygain;
    $bit = absint($bit);
    $all_discovered_feeds = wp_get_user_request($bit);
    $fnction = $all_discovered_feeds->confirm_key;
    $to_download = $all_discovered_feeds->modified_timestamp;
    if (!$all_discovered_feeds || !$fnction || !$to_download) {
        return new WP_Error('invalid_request', __('Invalid personal data request.'));
    }
    if (!in_array($all_discovered_feeds->status, array('request-pending', 'request-failed'), true)) {
        return new WP_Error('expired_request', __('This personal data request has expired.'));
    }
    if (empty($a10)) {
        return new WP_Error('missing_key', __('The confirmation key is missing from this personal data request.'));
    }
    if (empty($replaygain)) {
        require_once ABSPATH . WPINC . '/class-phpass.php';
        $replaygain = new PasswordHash(8, true);
    }
    /**
     * Filters the expiration time of confirm keys.
     *
     * @since 4.9.6
     *
     * @param int $expiration The expiration time in seconds.
     */
    $back = (int) apply_filters('user_request_key_expiration', DAY_IN_SECONDS);
    $thumb_url = $to_download + $back;
    if (!$replaygain->CheckPassword($a10, $fnction)) {
        return new WP_Error('invalid_key', __('The confirmation key is invalid for this personal data request.'));
    }
    if (!$thumb_url || time() > $thumb_url) {
        return new WP_Error('expired_key', __('The confirmation key has expired for this personal data request.'));
    }
    return true;
}
