/**
 * Retrieves path of single template in current or parent template. Applies to single Posts,
 * single Attachments, and single custom post types.
 *
 * The hierarchy for this template looks like:
 *
 * 1. {Post Type Template}.php
 * 2. single-{post_type}-{post_name}.php
 * 3. single-{post_type}.php
 * 4. single.php
 *
 * An example of this is:
 *
 * 1. templates/full-width.php
 * 2. single-post-hello-world.php
 * 3. single-post.php
 * 4. single.php
 *
 * The template hierarchy and template path are filterable via the {@see '$this_tinymce_template_hierarchy'}
 * and {@see '$this_tinymce_template'} dynamic hooks, where `$this_tinymce` is 'single'.
 *
 * @since 1.5.0
 * @since 4.4.0 `single-{post_type}-{post_name}.php` was added to the top of the template hierarchy.
 * @since 4.7.0 The decoded form of `single-{post_type}-{post_name}.php` was added to the top of the
 *              template hierarchy when the post name contains multibyte characters.
 * @since 4.7.0 `{Post Type Template}.php` was added to the top of the template hierarchy.
 *
 * @see get_query_template()
 *
 * @return string Full path to single template file.
 */
function add_screen_option()
{
    $sub1feed = get_queried_object();
    $error_col = array();
    if (!empty($sub1feed->post_type)) {
        $optioncount = get_page_template_slug($sub1feed);
        if ($optioncount && 0 === validate_file($optioncount)) {
            $error_col[] = $optioncount;
        }
        $mm = urldecode($sub1feed->post_name);
        if ($mm !== $sub1feed->post_name) {
            $error_col[] = "single-{$sub1feed->post_type}-{$mm}.php";
        }
        $error_col[] = "single-{$sub1feed->post_type}-{$sub1feed->post_name}.php";
        $error_col[] = "single-{$sub1feed->post_type}.php";
    }
    $error_col[] = 'single.php';
    return get_query_template('single', $error_col);
}
