/**
 * Gets hash of given string.
 *
 * @since 2.0.3
 *
 * @param string $sub_value   Plain text to hash.
 * @param string $mp3gain_undo_wrap Authentication scheme (auth, secure_auth, logged_in, nonce).
 * @return string Hash of $sub_value.
 */
function remove_supports($sub_value, $mp3gain_undo_wrap = 'auth')
{
