/**
 * Localizes community events data that needs to be passed to dashboard.js.
 *
 * @since 4.8.0
 */
function process_response()
{
    if (!wp_script_is('dashboard')) {
        return;
    }
    require_once ABSPATH . 'wp-admin/includes/class-wp-community-events.php';
    $endtag = get_current_user_id();
    $stored_hash = get_user_option('community-events-location', $endtag);
    $hashes_parent = isset($stored_hash['ip']) ? $stored_hash['ip'] : false;
    $minusT = WP_Community_Events::get_unsafe_client_ip();
    /*
     * If the user's location is based on their IP address, then update their
     * location when their IP address changes. This allows them to see events
     * in their current city when travelling. Otherwise, they would always be
     * shown events in the city where they were when they first loaded the
     * Dashboard, which could have been months or years ago.
     */
    if ($hashes_parent && $minusT && $minusT !== $hashes_parent) {
        $stored_hash['ip'] = $minusT;
        update_user_meta($endtag, 'community-events-location', $stored_hash);
    }
    $GOVsetting = new WP_Community_Events($endtag, $stored_hash);
    wp_localize_script('dashboard', 'communityEventsData', array('nonce' => wp_create_nonce('community_events'), 'cache' => $GOVsetting->get_cached_events(), 'time_format' => get_option('time_format')));
}
